import React from "react";
import { Routes, Route } from 'react-router-dom';
import Home from './Component/Home'
// import { StrictMode } from "react";
// import {createRoot} from 'react-dom/client';

const App = () => {
  return(
    <>
    <Routes>
      <Route exact path="/" element = {<Home/>}/>
    </Routes>
    </>
  )
}

export default App;
